import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useHistory } from 'react-router-dom';

const ListComponent = (username) => {
  const [songs, setSongs] = useState([]);
  const history = useHistory();

  useEffect(() => {
    axios
      .get('http://localhost/index.php/song/list')
      .then((response) => {
        setSongs(response.data);
      })
      .catch((error) => {
        console.error('Error fetching songs:', error);
      });
  }, []);

  return (
    <tbody>
      {songs.map((song) => (
        <tr key={song.id}>
          <td>{song.user}</td>
          <td>{song.title}</td>
          <td>{song.artist}</td>
          <td>{song.rating}</td>
          <td>
            {username === song.user && (
              <div>
                <button onClick={() => history.push(`/edit/${song.id}`)}>Edit</button>
                <button onClick={() => history.push(`/delete/${song.id}`)}>Delete</button>
              </div>
            )}
          </td>
        </tr>
      ))}
    </tbody>
  );
};

export default ListComponent;
